    "Bakery",
    "Fruits ans vegetables",
    "Meat and fish",
    "Drinks",
    "Kitchen",
    "Special nutrition",
    "Baby",
    "Pharmacy",
  ];

  return(
    <div className={classes.header}>
      <Navbar />
      <SearchBlock />
      <Menus points={categories}/>
    </div>
  )
};

export default Header;
